import { useEffect, useState } from 'react';



function App() {

  const [counter, setCounter] = useState(0)

  useEffect(() => {
    console.log('counter', counter)
  }, [])

  const handleOnclick = () => setCounter(prev => prev + 1)



  return (
    <div>
      <button onClick={handleOnclick}>
         counter {counter}
      </button>
    </div>
  );
}

export default App;
